import React, {useEffect} from 'react'
import { Row, Col, Button, Card, Avatar, Dropdown, Table, Menu, Tag } from 'antd';
import PropTypes from "prop-types";
import { ArrowUpOutlined, ArrowDownOutlined, CopyOutlined, FolderOpenOutlined, StopTwoTone, EllipsisOutlined } from '@ant-design/icons';
import { useSelector, useDispatch  } from 'react-redux'
import {getTacBalance, getEtherBalance} from 'services/EtherScanService'


const TacInfoWidget = () => {
    const {userInfo} = useSelector(state => state.auth)
	const [tacBalance, setTacBalance] = useState()
	const [ethBalance, setEthBalance] = useState()





	useEffect(()=>{
		 getTacBalance(userInfo.WalletAddress).then(result => setTacBalance(result))
	},[userInfo])


	return (
		<Card >
			<div className="mt-5">{tacBalance} </div>
		</Card>
	)
}

WalletWidget.propTypes = {
  	title: PropTypes.oneOfType([
		PropTypes.string,
		PropTypes.element
	]),
	tacBalance: PropTypes.number,
	address: PropTypes.string,
	status: PropTypes.string,
	prefix: PropTypes.element,
	extra: PropTypes.object
};

export default TacInfoWidget
